emporary applescript file to tell Xcode to load a docset.\necho \"telling XCode to load DocSet\"\nrm -f \"$TEMP_DIR/loadDocSet.scpt\"\n\necho \"tell application \\\"Xcode\\\"\" >> $TEMP_DIR/loadDocSet.scpt\necho \"load documentation set with path \\\"/Users/$USER/Library/Developer/Shared/Documentation/DocSets/$DOCSET_BUNDLE_ID.docset\\\"\" >> $TEMP_DIR/loadDocSet.scpt\necho \"end tell\" >> $TEMP_DIR/loadDocSet.scpt\n\n#  Run the load-docset applescript command.\necho \"Run applescript to tell XCode to load the docset\"\narch -i386 osascript \"$TEMP_DIR/loadDocSet.scpt\"\n\nexit 0";
